import React,{useState,useEffect} from 'react';

function Emp(){


    const [user,setUser]=useState([]);

    const getData= async()=>{
        const result=await fetch("http://localhost:8001/Data");
        const res=await result.json();
        setUser(res);
        console.log(res)
    }
    useEffect(()=>{
        getData()
    },[])
    return(
       <div className="container">
            <h3>Employee Data</h3>

            <table class="table">
  <thead>
    <tr>
      <th scope="col">#</th>
      <th scope="col">First</th>
      <th scope="col">Last</th>
      <th scope="col">Handle</th>
    </tr>
  </thead>
  <tbody>
    <tr>
      <th scope="row">1</th>
      <td>Mark</td>
      <td>Otto</td>
      <td>@mdo</td>
    </tr>
    <tr>
      <th scope="row">2</th>
      <td>Jacob</td>
      <td>Thornton</td>
      <td>@fat</td>
    </tr>
   
  </tbody>
</table>
{/*             
            {user.map((value)=>{
                return(
                    <>
                    <p>{value.name}</p>
                    </>
                )
            })} */}
       </div>
    )
}
export default Emp;
